doc/native/DataModel.html.body:
DataModelDataModel是原生应用与WebView进行数据交换的桥梁。原生应用可以通过 DataModel 模块，向 WebView 传递数据。

WebView 也可以通过 DataModel 模块，向 原生应用 传递数据。

Interfacelego.native.data: (key: string, value?: any) => Promise
Example// 读取
lego.native.data.get("aKey")
    .then(function(value){
        // ...
    })

// 设置
lego.native.data.set("aKey", "aValue")

// 监听
lego.native.data.watch("aKey", function(newValue){

})

doc/native/HTTPRequest.html.body:
HTTPRequest使用 HTTPRequest 模块可以突破跨域限制，无须JSONP，直接获取任意HTTP数据。如果HTTP数据是 UTF-8 字符串，则直接返回 responseText，否则，返回 Base64 编码后的 String 至 responseData。你还可以添加自定义的 HTTP Header 到请求的头部。安全如果使用该 API，Native 会禁用任何自带的 Cookie 信息，以保证安全性。如果需要使用 Cookie，你需要自行将其添加至 Header 中，或者使用Web提供的Ajax方法。Interfacelego.native.request: (
    url: string, 
    requestParam?: LGOHTTPRequestParam ) => Promise

interface LGOHTTPRequestParam{
    method? : string = "GET"
    timeout? : number
    data? : Object
    header? : Object
}
interface LGOHTTPResponse {
    json?: Object
    base64?: string
    text?: string 
}
Example// 获取一个GitHub的接口数据
lego.native.request("https://status.github.com/api.json", {
    header: { aKey: "aValue" }
}).then(function(result){
    result.json && console.log(result.json)
})

// 获取图片数据
lego.native.request("http://www.huanju.cn/s/v1206/HuanJu-LOGO-PNG.png")
    .then(function(result){
        result.base64 && console.log(result.base64)
    })

doc/native/Notification.html.body:
Notification使用 Notification 可以跨 WebView 通讯，而 Notification 在 iOS 中实际上就是 NSNotification，在 Android 中实际上就是 Boardcast。一个通知可以分为两个角色，发送者、观察者。发送者，负责发送通知。观察者，负责响应通知。使用 Notification 模块除了可以响应通知以外，还可以接收到通知的额外信息。使用 Notification 模块也可以发送通知信息。Interface
lego.native.event.on: (namespace: string, callback: (data: Object) => void) => void
lego.native.event.off: (namespace?: string) => void
lego.native.event.trigger: (namespace: string, data: any) => void

Example// 监听原生事件
lego.native.event.on(kAppBecomeActive, function(){
    // do something
})

// 主动发送通知
lego.native.event.trigger("Test", "This notification is post via WebView")

// 移除所有事件
lego.native.event.off()

doc/native/OpenIntent.html.body:
