doc/native/UserDefaults.html.body:
UserDefaultsUserDefaults 模块可以保存一些简单的数据，并持久化到闪存中。UserDefaults 和 Cookie 比较类似，不同的是， UserDefaults 并不会默认传输到网站， UserDefaults 相当于一个简单的 Key-Value 数据库。UserDefaults 可以创建多个仓库，不同仓库有不同的 Key-Value 数据。Interfacelego.native.preference.set: (data: Object, suite?: string) => Promise
lego.native.preference.get: (key: string, suite?: string) => Promise
lego.native.preference.remove: (key: string, suite?: string) => Promise

Examplelego.native.preference.set({
    test: "hello"
})
lego.native.preference.get("test")
    .then(function(value){
        // ...
    })

doc/ui/ActionSheet.html.body:
ActionSheet使用 ActionSheet 可以弹出一个包含多个选项的对话框，用户选择对应选项后会有回调。点击取消选项和点击蒙版区域触发相同的事件。Interfacelego.ui.sheet: (
    title: string, 
    choices: string[], 
    cancelText?: string, 
    redIndex?: number) => Promise

Examplelego.ui.sheet("请问，罗老板隐婚了多久？", ["一年", "两年", "三年", "五年"], "我选择死亡", 3)
    .then(function(tapIndex){
        console.log(tapIndex)
    })

// 不指定 cancelText 和 redIndex
lego.ui.sheet("请问，罗老板隐婚了多久？", ["一年", "两年", "三年", "五年"])
    .then(function(tapIndex){
        console.log(tapIndex)
    })

// 仅指定 redIndex 
lego.ui.sheet("请问，罗老板隐婚了多久？", ["一年", "两年", "三年", "五年"], undefined, 3)
    .then(function(tapIndex){
        console.log(tapIndex)
    })

doc/ui/AlertView.html.body:
AlertView使用 AlertView 模块弹出一个原生的警告对话框，用户选择对应选项后会有回调。Interfacelego.ui.alert: (
    title: string, 
    message?: string, 
    btnTitles?: string[]) => Promise

Example// 不指定 message
lego.ui.alert("即将毁灭地球，请确认。", undefined, ["马上毁灭", "稍后再试"])
    .then(function(tapIndex){
        if (tapIndex == 0) {
            console.log("正在发射核弹...")
        }
        else {
            console.log("太迟了......")
        }
    })

// 仅标题
lego.ui.alert("即将毁灭地球，请确认。")

doc/ui/AppFrame.html.body:
AppFrame使用 AppFrame 模块可以替换掉应用的顶层界面。如果 items 有多个 item，则替换成 TabBarController，iOS Only。否则替换成 NavigationController。在 iOS 下，顶层 ViewController.accessibilityLabel 其值必须是 "AppFrame" 方可使用该 API。

Interfacelego.ui.appFrame: (items: LGOFrameItem[]) => Promise

interface LGOFrameItem {
    path: string,
    icon?: string,
    title?: string,
    args?: Object,
    statusBarHidden?: boolean 
    navBarHidden?: boolean
