doc/ui/Refresh.html.body:
Refresh使用 Refresh 模块可以为 WebView 添加一个原生的下拉刷新控制器。Interfacelego.ui.refresh.enable: (callback?: () => void) => void
lego.ui.refresh.complete: () => void

Example// 刷新开启，5s后关闭
lego.ui.refresh.enable(function(){
    setTimeout(function(){
        lego.ui.refresh.complete()
    }, 5000)
})


// 下拉拉取数据，完成后关闭
lego.ui.refresh.enable(function(){
    lego.native.request("https://status.github.com/api.json")
        .then(function(result){
            // ...
            lego.ui.refresh.complete()
        })
})

doc/ui/NavigationController.html.body:
NavigationController使用 NavigationController 模块，你可以将应用跳转至下一个页面，也可以返回至上一个页面。提供 path 参数，并为其提供一个URL，即可跳转至下一页。提供 args 参数，并为其提供一些下一页面所需要的变量，下一页面可以通过 window._args 访问到。Interface
lego.nav.pop: () => Promise
lego.nav.push: (
    path: string, 
    options?: LGONavOptions, 
    args?: Object, 
    animated?: boolean) => Promise

interface LGONavOptions {
    title?: string
    navBarHidden?: boolean
    statusBarHidden?: boolean
}    

Example// #1
lego.nav.push("https://www.google.com.hk/", {
    title: "Google",
    statusBarHidden: false
}, {
    customID: 8888
})

// #2
lego.nav.pop()

doc/ui/NavigationItem.html.body:
NavigationItem使用 NavigationItem 模块可以自定义应用页面导航栏左侧按钮、右侧按钮以及页面标题。也可以使用 NavigationItem 模块设置下一页面的返回按钮标题。其中左侧按钮、右侧按钮可以设置为文本按钮或者图标按钮。InterfacenavItem: (
    title?: string, 
    leftItem?: string, 
    rightItem?: string, 
    backText?: string, 
    callback?: (rightTapped: boolean)=>void) => Promise

interface NavItemBuilder {
    build: () => NavItemBuilder
    exec: () => void
    setTitle: (title: string) => NavItemBuilder
    setLeftText: (text: string) => NavItemBuilder
    setLeftIcon: (uri: string) => NavItemBuilder
    setRightText: (text: string) => NavItemBuilder
    setRightIcon: (uri: string) => NavItemBuilder
    setBackText: (text: string) => NavItemBuilder
    setTapListener: (cb: (rightTapped: boolean) => void) => NavItemBuilder
}    

Example// 仅设置标题 #1
lego.ui.navItem("title")

// 仅设置标题 #1
lego.ui.navItemBuilder.build().setTitle("title").exec()


// 设置左文案、右图标 #2
lego.ui.navItem("title", "返回", "path/to/icon.png")

// 设置左文案、右图标 #2
lego.ui.navItemBuilder.build().setLeftText("返回").setRightIcon("path/to/icon.png").exec()


// 设置回调 #3
lego.ui.navItem(undefined, "返回", "进入", undefined, function(rightTapped){
    if (rightTapped) {
        console.log("rightTapped")
    }
    else {
        console.log("leftTapped")
    }
})

// 设置回调 #3
lego.ui.navItemBuilder.build()
    .setLeftText("返回")
    .setRightText("进入")
    .setTapListener(function(rightTapped){
        console.log(rightTapped? "rightTapped": "leftTapped")
    })
    .exec()

doc/ui/ModalController.html.body:
ModalControllerModalController 与 NavigationController 使用方法类似，但是，ModalController 跳转的页面，是以模态的形式呈现的。Interfacelego.ui.modal.hide: (animated?: boolean) => Promise
lego.ui.modal.show: (path: string, options?: LGONavOptions, args?: Object, animated?) => Promise

interface LGONavOptions {
    title?: string
    navBarHidden?: boolean
    statusBarHidden?: boolean
}
Example// #1
